import { CHANGE_INPUT, ADD_ITEM, DELETE_ITEM } from './actionTypes'

export const changeInputAction = (value) => ({
  type: CHANGE_INPUT,
  value
})

export const addItem = () => ({
  type: ADD_ITEM,
  value
})

export const deleteItem = (value) => ({
  type: DELETE_ITEM,
  value
})
